import logo from './chucknorris_logo.png';
import './index.css';
import React, { Component } from 'react';
import ReactDOM from 'react';

class App extends Component{
  constructor(props){
    super(props);
    this.fetchapi.bind(this);
  }
  factapi(){
    let response = fetch('https://api.chucknorris.io/jokes/random');
    let data = response.text();
    console.log(data)
  }

  return(){

    <div className="App">

      <div className='header'>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Click Button to get Random chuck Facts
        </p>
        <button className='button-5' onClick={factapi()}>
          FACTS
        </button>             
      </div>
    </div>;
  }
}

export default App;
